','2019-12-16 09:06:33'),(27,'Ariansyah','Semoga lebih bermanfaat untuk kedepannya dan menuju masa depan yang lebih cemerlang','2019-12-16 09:20:28','2019-12-16 09:20:28'),(28,'Ariansyah','Semoga bermanfaat untuk kedepannya dan menuju ke masa depan yang lebih cemerlang','2019-12-16 09:22:22','2019-12-16 09:22:22'),(29,'Nita surahmi','Semoga menbuat fakultas teknik uts makin maju dan haha salam satu jiwat','2019-12-16 09:52:50','2019-12-16 09:52:50'),(30,'Akbar Algifari','No coment','2019-12-16 09:57:11','2019-12-16 09:57:11'),(31,'<div><center> <h1>ASU</h1></center></div>','<div><center> <h1>ASU</h1></center></div>','2019-12-16 09:59:23','2019-12-16 09:59:23'),(32,'Ikhda Qurrata Aini','Saya berharap agar mahasiswa tidak berbeasiswa agar dibantu untuk mendapatkan beasiswa. Soalnya kuliah mahal:\'v apalagi uang kos:) belum lagi keuangan sehari-hari:) di khususkan banget deh buat mahasiswa reguler yang berprestasi. Sayang banget punya prestasi tapi ga dapet beasiswa.','2019-12-16 10:01:07','2019-12-16 10:01:07'),(33,'Arif fahmi','lebih tegas di harapkan agar mempperhatikan lagi mahasiswa teknik agar lebih aktif dan saya sangat beerkesan dengan kerja kerasnya','2019-12-16 10:02:53','2019-12-16 10:02:53'),(34,'Abdullah Azzam','Semangat untuk BEM FT!!!\r\nAspirasi saya yaitu :\r\nTolong pastikan kelas untuk program studi Metalurgi!!!  Apa harus terpisah? Apa harus bertolak belakang dengan semboyan kita? \r\n#Teknik_Satu!!!!\r\n\r\n\r\n\r\n#Bergeraklah!!! Karena itu tandanya kita hidup','2019-12-16 10:04:28','2019-12-16 10:04:28'),(35,'Nurmi Santi','Teruslah berjuang walaupun dalam tekanan sebesar apapun,jangan pernah mengeluh dalam melakukan segala hal.','2019-12-16 10:05:44','2019-12-16 10:05:44'),(36,'Eka etiana','Bisa lebih baik lagi untuk kedepannya, dan untuk para pengurus BEM, saran jangan jadi mahasiswa yang berfikir bahwa kalian paling baik di teknik, dan jangan menjadi sombong karena jabatan Klian. Kedepannya lebih baik dan kreatif yah','2019-12-16 10:22:12','2019-12-16 10:22:12'),(37,'Ridho Rabbani','Mana kartu Tanda Mahasiswa','2019-12-16 10:34:26','2019-12-16 10:34:26'),(38,'Temannya young lex','Tolong dong urus KTM biar cepat kelar, sama kipas angin kelas di adakan','2019-12-16 10:39:52','2019-12-16 10:39:52'),(39,'Ajie prana mesa','Sukses selalu','2019-12-16 11:05:17','2019-12-16 11:05:17'),(40,'Junianto saputra','Semoga BEM FT makin jaya','2019-12-16 11:16:14','2019-12-16 11:16:14'),(41,'Candra','Selalu menjadi wadah bagi adik adik maba teknik sehingga bisa lebih berkembang dan maju\r\nSemangat BEM-FT','2019-12-16 11:16:33','2019-12-16 11:16:33'),(42,'Kurniawati','Tetap totalitas walaupun di hadapkan dgn banyaknya urusan lain karena FT butuh orang yg berkomitmen','2019-12-16 11:25:46','2019-12-16 11:25:46');
